import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class Filter extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        return (
            <div>
                <label>
                    <input 
                        type="text"
                        name="filter"
                        // value={this.state.contacts}   
                        // onChange={} 
                    />                    
                </label>
            </div>
        )
    }
}
